import { useState } from "react";
import UploadFile from "./UploadFile";

const Home = () => {
  const [lyrics, setLyrics] = useState("");
  const [filename, setFilename] = useState("");
  return (
    <div style={div}>
      <h1>Music To Image</h1>
      <UploadFile changeLyrics={setLyrics} changeFile={setFilename} />
      <h3>{`Filename: ${filename}`}</h3>
      <h3>{`Lyrics:`}</h3>
      <p>{lyrics}</p>
    </div>
  );
};

const div = {
  textAlign: "center",
  margin: "auto",
};

export default Home;
